                    color="primary"
                    startIcon={<SendIcon />}
                    sx={{ py: 2, fontSize: 18 }}
                    onClick={() => navigate("/transfer")}
                >
                    –°–¥–µ–ª–∞—Ç—å –ø–µ—Ä–µ–≤–æ–¥
                </Button>
                <Button
                    fullWidth
                    variant="outlined"
                    color="secondary"
                    startIcon={<HistoryIcon />}
                    sx={{ py: 2, fontSize: 18 }}
                    onClick={() => navigate("/transactions")}
                >
                    –ò—Å—Ç–æ—Ä–∏—è —Ç—Ä–∞–Ω–∑–∞–∫—Ü–∏–π
                </Button>
                <Button
                    fullWidth
                    variant="outlined"
                    color="info"
                    startIcon={<SettingsIcon />}
                    sx={{ py: 2, fontSize: 18 }}
                    onClick={() => navigate("/settings")}
                >
